import { loginPageReducer } from "../pages/login/reducers";
import { configureStore } from "@reduxjs/toolkit";

const rootReducer = {
    loginPage: loginPageReducer,
    productsPage: prod
};

export const store = configureStore({
    reducer: rootReducer
});
